import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-trabajos-realizados',
  templateUrl: './trabajos-realizados.component.html',
  styleUrls: ['./trabajos-realizados.component.scss']
})
export class TrabajosRealizadosComponent {
  @Input() title: string = 'Trabajos';

  workList = [{
    "id": 1,
    "title": "Primer Trabajo",
    "urlImage": "data:image/jpeg;base64,",
    "description": "fizcalizacion presencial, etx"
  },

  {
    "id": 2,
    "title": "segundo Trabajo",
    "urlImage": "https://www.google.com/imgres?imgurl=https%3A%2F%2Fpropiedades.com.co%2Fwp-content%2Fuploads%2F2021%2F03%2FLogos-1-1-350x322.jpg&tbnid=eEyBwa5pLHt6nM&vet=12ahUKEwiEh5ae7oP-AhWEuZUCHQ8FDqQQMygAegUIARDFAQ..i&imgrefurl=https%3A%2F%2Fpropiedades.com.co%2Fconstructora%2Flink-inmobiliario%2F&docid=1mE9fhxpUxKlZM&w=350&h=322&q=link%20logo%20inmobiliaria&ved=2ahUKEwiEh5ae7oP-AhWEuZUCHQ8FDqQQMygAegUIARDFAQ",
    "description": "inmobiliaria, etx"
  },

  {
    "id": 3,
    "title": "Tercer Trabajo",
    "urlImage": "https://scontent-eze1-1.xx.fbcdn.net/v/t39.30808-6/292241321_132404876146081_4669233547178520931_n.jpg?_nc_cat=109&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=kZhA4nfmDEEAX_txuOc&_nc_ht=scontent-eze1-1.xx&oh=00_AfAvb9IA8nVVcssy-_xaL4z4knHKOZXleVY2iivkpsrf4Q&oe=642B7055",
    "description": "Productor asesor de seguros"
  }


  ];

}
